import React, { Component } from 'react';

import { Butt  } from '../components/Butt';
import { Head3 } from '../styles/Head3';
import { Head4 } from '../styles/Head4';

import Information from '../components/Information';

export default class About extends Component {
	render() {
		return (

		<section>
		  <div className="about-img"></div>	        
	        <div className="container">
	          <div className="row">
	            <div className="col-10 mx-auto col-md-8 mt-4">
	              <Head3 className="text-center text-capitalize mb-2"> about me</Head3>
	              <Head4 className="text-center"> My name is Rose Renie Canlas. I'm a UX designer and front-end developer.
	               <br />This is my personal website.</Head4> 
	              <div className="btn-upper text-center mb-4">
	                <form>            
	                  <Butt className="btn-upper" type="submit"> 
	                    Learn more 
	                  </Butt>
	                </form>       
	              </div>                      
	            </div>
	          </div>
	        </div>
	         <Information /> 

	    </section>

		);
	}
}
